import { ReactComponent as LogoKubsu } from '../image/Logosvg.svg';

export default function Welcome() {

    const HideLogo = ()=> {
        setTimeout(console.log('Timeout!'), 2000)
    }
    HideLogo();
    return <>
        <LogoKubsu/>
    </>
}
